import { useDispatch, useSelector } from "react-redux"
import { RentalDetails } from "./RentalDetails"
import { useEffect } from "react"
import { reset } from "../Functions/Reset"

export const ViewAllRentals = () => {

    const rentals = useSelector(x => x.Lends)

    console.log(rentals);
    
    console.log(rentals.length);
    
    console.log(rentals);

    console.log(rentals.map(x=>x));
    
    
    return <div className="allRentals">
        {rentals.map((r, i) => { console.log(`r: ${JSON.stringify(r)},  i: ${i}`);
         return <div key={i} className="rentalDetails"><RentalDetails rental={r} manager={true}></RentalDetails></div>})}
    </div>
}
